all_data = {}
i = 0
for html_data in html_data_all:
    i += 1
    # Parse the HTML with BeautifulSoup
    soup = BeautifulSoup(html_data, 'html.parser')

    # Find the table element by selecting the first table in the HTML
    table = soup.find('table')
    # Initialize an empty list to store the table rows
    data = []

    # Iterate through the rows in the table (skip the header row)
    for row in table.find_all('tr')[1:]:
        columns = row.find_all('td')
        item = {
            "list_number": columns[0].text.strip(),
            "number_on_list": columns[1].text.strip(),
            "surname_and_names": columns[2].text.strip(),
            "occupy": columns[3].text.strip(),
            "place_of_living": columns[4].text.strip(),
            "political_party": columns[5].text.strip(),
            "lustration_statement": columns[6].text.strip(),
            "committee": columns[7].a.text if columns[7].a else ""
        }
        data.append(item)
    all_data["constituency_nr_"+str(i)] = data
    # Convert the data list to JSON
json_data = json.dumps(all_data, ensure_ascii=False, indent=4)

output_file = "candidates.json"

# Write the JSON data to the file
with open(output_file, "w", encoding="utf-8") as file:
    file.write(json_data)

print(f"JSON data saved to {output_file}")
